import { useState, useEffect } from "react";
import { getProfile } from "../../services";

const Profile = () => {
    const [ user, setUser ] = useState(null);

    const fetchUser = async () => {
        const response = await getProfile();
        setUser(response);
    };

    useEffect( ()=> {
        fetchUser() ;
    }, []);

    return (
        <div>
            <h1>Mi Perfil</h1>
        </div>
    )
};

export default Profile;
